var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "ArtemTerziRealtyFUI");
var priceColumn = esq.AddColumn("ArtemTerziPriceUSD");  // SELECT ArtemTerziPriceUSD as ArtemTerziPriceUSD, ArtemTerziArea as ArtemTerziArea FROM ArtemTerziRealtyClassic WHERE ...
var areaColumn = esq.AddColumn("ArtemTerziArea");

Guid typeId = Get<Guid>("RealtyTypeIdParameter");
Guid offerTypeId = Get<Guid>("RealtyOfferTypeIdParameter");

var typeFilter = esq.CreateFilterWithParameters(FilterComparisonType.Equal, "ArtemTerziType", typeId);
esq.Filters.Add(typeFilter);

var offerTypeFilter = esq.CreateFilterWithParameters(FilterComparisonType.Equal, "ArtemTerziOfferType", offerTypeId);
esq.Filters.Add(offerTypeFilter); // ... WHERE ArtemTerziTypeId = :typeId AND ArtemTerziOfferTypeId = :offerTypeId

string sqlText = esq.GetSelectQuery(UserConnection).GetSqlText();
Set("SqlTextParameter", sqlText);

var entityCollection = esq.GetEntityCollection(UserConnection);
decimal totalUSD = 0;
decimal totalArea = 0;
foreach(var entity in entityCollection) {
	decimal price = entity.GetTypedColumnValue<decimal>(priceColumn.Name); // reading using column alias
	decimal area = entity.GetTypedColumnValue<decimal>(areaColumn.Name); // reading using column alias
	totalUSD = totalUSD + price;
	totalArea = totalArea + area;
}

decimal result = 0;
if (totalArea > 0) {
	result = totalUSD / totalArea;
}

Set("AvgPriceUSDParameter", result);

return true;
